import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import App from './App';
import DigitalLandscapes from './pages/DigitalLandscapes';
import PlaylistLocalization from './pages/PlaylistLocalization';
import WebVerify from './pages/WebVerify';
import UnifiedAuth from './pages/UnifiedAuth';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/case-studies/digital-landscapes" element={<DigitalLandscapes />} />
        <Route path="/case-studies/playlist-localization" element={<PlaylistLocalization />} />
        <Route path="/case-studies/webverify-expansion" element={<WebVerify />} />
        <Route path="/case-studies/unified-auth" element={<UnifiedAuth />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
